import React from 'react';

const Header = () => {
  // Estilos en línea para el header
  const headerStyle = {
    backgroundColor: '#333', // Cambia el color de fondo según tus preferencias
    color: '#fff', // Cambia el color del texto según tus preferencias
    padding: '10px', // Ajusta el espacio interno según tus preferencias
  };

  return (
    <header style={headerStyle}>
      <div>
        <h1>Mi Sitio Web</h1>
      </div>
      <nav>
        <ul>
          <li><a href="/">Inicio</a></li>
          <li><a href="/login">Acerca de</a></li>
          <li><a href="/form">Servicios</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
